script: |
  super -f text -I q4449.spq | sort > q4449.out

inputs:
  - name: q4449.spq
    data: |
      SELECT col2 + - - col0 * + col2 AS col0 FROM tab2 (FORMAT parquet) AS cor0 WHERE NOT - col1 / - - 69 * - 11 BETWEEN - + col2 AND - + col1;
  - name: tab2

outputs:
  - name: q4449.out
    data: |
      1081
      2600
      4408
